module.exports = {"code":0,"data":{"title":"市纪委驻市工信委纪检组迅速传达学习省市纪委会议精神安排部署下半年工作","content":"<body style=\"\" class=\"\" align=\"\" color=\"\"> <p style=\"\" class=\"\" align=\"\" color=\"\"> 6月29日下午，驻市工信委纪检组召开专题会议，迅速传达学习全省纪检监察工作座谈会精神及全市纪检监察领导干部大会精神，研究贯彻落实措施及下一阶段重点工作。会议由驻市工信委纪检组组长周兴鹏主持，纪检组和机关纪委干部参加会议。 </p>  <p style=\"\" class=\"\" align=\"\" color=\"\"> <br style=\"\" class=\"\" align=\"\" color=\"\"> </p>  <p style=\"\" class=\"\" align=\"\" color=\"\"> <img src=\"http://image.wiimedia.cn/nongjibao/f7abdc78af9e4d349136e9d3fee2bece.jpg\" alt=\"\" style=\"\" class=\"\" align=\"\" color=\"\"> </p>  <p style=\"\" class=\"\" align=\"\" color=\"\"> <br style=\"\" class=\"\" align=\"\" color=\"\"> </p>  <p style=\"\" class=\"\" align=\"\" color=\"\"> 会上，全体纪检干部认真学习了省市纪委会议精神、省委常委、省纪委书记王兴宁的重要讲话精神及市委常委、市纪委书记、市监委主任卢力群的重要讲话精神。会议指出，王兴宁书记及卢力群书记的重要讲话，政治站位高、目标定位准、思路谋划新、工作部署实，为下一阶段的纪检监察工作指明了发展方向。全体纪检干部要把传达学习座谈会精神及领导讲话作为当前的一项重要政治任务，认真传达学习、深刻领会，全面总结工作，主动查找不足，进一步细化举措，安排好下半年各项工作任务。纪检组下一步将继续围绕重要节点，紧盯突出问题，加大查处违反中央八项规定精神问题、“微腐败”等工作力度，积极推动“以案促改”工作，全力推进“三个助力”及“三个年”活动，努力在下一阶段工作中取得更大成绩。 </p>  <p style=\"\" class=\"\" align=\"\" color=\"\"> <br style=\"\" class=\"\" align=\"\" color=\"\"> </p>  <p style=\"\" class=\"\" align=\"\" color=\"\"> <img src=\"http://image.wiimedia.cn/nongjibao/88fae3d30fe849debbef63e2ebcc4ec0.jpg\" alt=\"\" style=\"\" class=\"\" align=\"\" color=\"\"> </p>  <p style=\"\" class=\"\" align=\"\" color=\"\"> <br style=\"\" class=\"\" align=\"\" color=\"\"> </p>  <p style=\"\" class=\"\" align=\"\" color=\"\"> 会议要求，一是迅速传达学习，认真贯彻落实省市纪委会议精神。纪检组全体干部要提高政治站位，统一思想认识，深刻领会会议精神内涵，以“五个积极作为”、“五个牢牢把握”为根本抓手，更加自觉地把“两个维护”落实到各项具体工作中，强化执纪审查，严明政治纪律和政治规矩。二是对标座谈会精神和工作要求，认真安排好下半年工作。重点围绕推进“五个专项”工作精准发力，强化对驻在部门落实中央八项规定精神的监督检查，提升干部遵规守纪的自觉性，加强对驻在部门扶贫工作和扶贫专项资金的使用情况进行督导检查，确保脱贫攻坚工作落实落细。三是围绕“三个年”活动，全面加强执纪监督监察工作。坚持稳中求进工作总基调，保持战略定力和斗争精神，把监督内容聚焦在政治监督、组织监督、纪律监督方面，发挥 “探头”作用，紧盯“三种人”，坚决做到“三个决不能”，切实把“五个专项”工作抓紧抓好。四是加强纪检监察干部能力建设。要结合市纪委关于开展“三进三查”和提升干部能力水平的要求，加强纪检监察体制改革后的业务知识学习，要提高政治站位，强化“四个意识”，着力锻造一支政治素质过硬，能力水平过硬，作风纪律过硬的纪检铁军队伍，努力助推驻在部门党风廉政建设取得新成效。 </p>  <p style=\"\" class=\"\" align=\"\" color=\"\"> <br style=\"\" class=\"\" align=\"\" color=\"\"> </p> </body>"}}

